import React from "react";
import HomeDiv from "../styledComponents";

const Home = () => {
  return (
    <>
      <HomeDiv>
        <h1>Deep Sleep</h1>
        <button type="button">Start</button>
      </HomeDiv>
    </>
  );
};

export default Home;
